import React, { useState } from "react";
import { Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { registerUser } from "../../redux/actions/authActions";

const Register = (props) => {
  const [login, setLogin] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [password2, setPassword2] = useState("");

  useEffect(() => {
    if (props.auth.isAuthenticated) {
      props.history.push("/orders");
    }
  });

  const onChangeEmail = (e) => {
    setEmail(e.target.value);
  };

  const onChangeLogin = (e) => {
    setLogin(e.target.value);
  };

  const onChangePassword = (e) => {
    setPassword(e.target.value);
  };

  const onChangePassword2 = (e) => {
    setPassword2(e.target.value);
  };

  onSubmit = (e) => {
    e.preventDefault();
    const newUser = {
      name: login,
      email: email,
      password: password,
      password2: password2,
    };
    props.registerUser(newUser, props.history);
  };

  const { errors } = props.state;
  return (
    <div>
      <section className="contact_form py-5">
        <div className="container">
          <div className="heading">
            <h1 className="heading text-capitalize mb-5 pb-3">
              <span>Register</span>
            </h1>
            <h4 className="position cont">Register</h4>
          </div>
          <form noValidate onSubmit={this.onSubmit}>
            <div className="input-w3ls w3ls-left">
              <input
                onChange={onChangeLogin}
                value={login}
                error={errors.name}
                id="name"
                type="text"
                placeholder="Логин"
              />
              <span className="text-danger font-weight-bold">
                {errors.name}
              </span>
            </div>
            <div className="input-w3ls w3ls-rght">
              <input
                onChange={onChangeEmail}
                value={email}
                error={errors.email}
                id="email"
                type="email"
                placeholder="Email"
              />
              <span className="text-danger font-weight-bold">
                {errors.email}
              </span>
            </div>
            <div className="input-w3ls w3ls-left">
              <input
                onChange={onChangePassword}
                value={password}
                error={errors.password}
                id="password"
                type="password"
                placeholder="Password"
              />
              <span className="text-danger font-weight-bold">
                {errors.password}
              </span>
            </div>
            <div className="input-w3ls w3ls-rght">
              <input
                onChange={onChangePassword2}
                value={password2}
                error={errors.password2}
                id="password2"
                type="password"
                placeholder="Confirm Password"
              />
              <span className="text-danger font-weight-bold">
                {errors.password2}
              </span>
            </div>
            <div className="input-w3ls">
              <input type="submit" value="Регистрация" />
            </div>
          </form>
        </div>
      </section>
    </div>
  );
};

Register.propTypes = {
  registerUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors,
});
export default connect(mapStateToProps, { registerUser })(withRouter(Register));
